        <style>

            .boundary {
                fill: none;
                stroke: #fff;
                stroke-linejoin: round;
                stroke-linecap: round;
            }

            .feature--canton {
                fill: #bbb;
            }

            .feature--lake {
                fill: steelblue;
                fill-opacity: .8;
            }

            .buttongroup {
                width: 100%;
                text-align: center;
            }

            #map {
                text-align: center;
                margin-bottom: 40px;
            }

            .buttongroup button {
                background: none;
                border: 1px solid #777;
                color: inherit;
                font: inherit;
                line-height: normal;
                padding: 5px;
                margin: 0;
                box-sizing: border-box;
                font-family: sans-serif;
            }

            .buttongroup button:first-child {
                border-radius: 5px 0 0 5px;
            }

            .buttongroup button:last-child {
                border-radius: 0 5px 5px 0;
                margin-left: -5px;
            }

            .buttongroup button:focus {
                background-color: aliceblue;
                outline: none;
            }


        </style>
